})
export class LoginComponent {

  loginForm = new FormGroup({
    emailid:new FormControl(''),
    password:new FormControl(''),
    typeofuser:new FormControl(''),
  })

  signIn():void {
    let login = this.loginForm.value;
    console.log(login);

  }
}
